import React from 'react'
import { connect } from 'react-redux'

import AppWindow from './AppWindow.js'
import { appsNames, appsLogos } from './appsData.js'

const Home = ({ firebase, apps }) => {
  if (!firebase.profile.isLoaded) return null

  console.log(apps.doordash)

  const userApps = appsNames.filter(app => apps.app)

  console.log(userApps)

  return (
    <div className = "home">
      <h1 className = "home-title"> Pick your App </h1>
      <p></p>

    </div>
  )
}

const mapStateToProps = ({ firebase }) => ({
  firebase,
  apps: firebase.profile.apps
})

export default connect(mapStateToProps)(Home)
